import React, {Component} from "react";
import handler from "uri-js";

class GetAllArticles extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        };
        //this.state = { artciles: };
    }
    componentDidMount(){
        fetch("http://localhost:8080/v1/api/cvindexer/allCV",
            {
                mode: 'no-cors',
            method:'GET',
            headers: {
            'Accept': '*/*',
                'Authorization': 'Basic cHJlc3RhdGFpcmVAYm5ic2l0dGVyLmNvbToxMjM0NTY=',
        }
    })
            .then(res => res.json())
    }
    render() {
        return (
            <div className="articles-list">
                <h1>Bienvenue sur la CVth√®que</h1>
                <ul>
                    <li>Instagram</li>
                    <li>WhatsApp</li>
                    <li>Oculus</li>
                </ul>
            </div>
        );
    }
}

export default GetAllArticles;
